function rotateLeft(t,u,h){return t<<u|t>>h-u}function rotateRight(t,u,h){return t>>u|t<<h-u}function stringToBytes(t){const u=[];for(let h=0;h<t.length;h++){let s=t.charCodeAt(h);s<=127?u.push(s):s<=2047?(u.push(192|s>>6),u.push(128|63&s)):s<=65535?(u.push(224|s>>12),u.push(128|s>>6&63),u.push(128|63&s)):(u.push(240|s>>18),u.push(128|s>>12&63),u.push(128|s>>6&63),u.push(128|63&s))}return u}
